import React from 'react'

import './cart.css' 

function Cart(props) {

    const cart = props.cart

    const totalPrice = cart.reduce(
        (total,product) => total + product.price
    ,0)



    return (
        <div>
            <h4>Order summery</h4>
            <p>items ordered : {cart.length}</p>   
            <p>Total Price : {totalPrice} </p>     
        </div>
    )
}

export default Cart
